import React from 'react';
import { useParams, useNavigate } from 'react-router-dom';

export default function PageLayout() {
  return (
    <Page params={useParams()} navigate={useNavigate()} />
  );
}

class Page extends React.Component {
  render() {

    let MyComponent = require('Forms/'+this.props.params.formName+'/'+this.props.params.pageNumber).default;
    return <MyComponent />;
  }
}
